import App1 from "./App1";
import App2 from "./App2";

const App = () => {
  return (
    <div className="app">
      <Routes>
        <Route path="/" element={<App1 />} />
        <Route path="/app2" element={<App2 />} />
      </Routes>
    </div>
  );
};

export default App;
